(77475, 'B76CF7E9-3AE3-40E5-8BE4-24BCF7CA9420', 'Hey love, realized I haven’t written you in a while to tell you how much I love you. (I know you value words!) Right now, I’ve been feeling secure and safe and loved and it is allowing me to explore new avenues of growth and experimentation that weren’t possible even 6months ago. I feel our connection is strong. I so appreciate all of the ways you showered me for my birthday. Thank you.  I’m excited about our upcoming travels to tahoe and Florida…I’d like to plan another experience akin to our “watsu” and lsd day. New depths and new heights with you. What could be better??? ', 'David', 'Nitzan', '2024-03-06T11:43:28.725543'),
(77476, 'DC24BE47-6AE4-4092-A7FE-FAC2605005ED', 'Ah, I️ love this note. And I️ feel SO similar. I️ feel so strong and confident — in my body, in my bones, and in my love for you and our lives together. ', 'Nitzan', 'David', '2024-03-06T11:50:39.260806'),
(77477, '399E68D5-D2D8-4C29-99E7-04678A300CD1', 'I️ have loved our new journeys of the last 6 months. ', 'Nitzan', 'David', '2024-03-06T11:50:57.584733'),
